__author__ = 'ernm'
linux = {
        'get': '',
        'list': '',
        'delete': '',
        'put': ''
    }
script = '''
#!/bin/bash

# CMDs
if [ -x /usr/sbin/mdata-get ]
then
    MDATA_GET=/usr/sbin/mdata-get
elif [ -x /lib/smartdc/mdata-get ]
then
    MDATA_GET=/lib/smartdc/mdata-get
else
    exit 1
fi
MDATA_DELETE=/usr/sbin/mdata-delete
SLEEP=/opt/local/bin/sleep
BASE64=/usr/bin/base64 # only used in linux
CHMOD=/bin/chmod
CAT=/bin/cat
NOHUP=/bin/nohup

# vars
RUN_TRIGGER=rerun-user-script
MDATA_DELETE_FIELD=mdata-delete-base64
CHECK_INTERVAL=5

# check if mdata-delete is available, should only happen on linux
if [ ! -x ${MDATA_DELETE} ]
then
    ${MDATA_GET} ${MDATA_DELETE_FIELD} > ${MDATA_DELETE}.base64
    ${BASE64} -d ${MDATA_DELETE}.base64 > ${MDATA_DELETE}
    ${CHMOD} +x ${MDATA_DELETE}
fi


${CAT} > /tmp/rerun-user-script <<_EOF
#!/bin/bash

# main event loop
while true
do
    ${MDATA_GET} ${RUN_TRIGGER} >/dev/null 2>&1
    if [ $? -eq 0 ]
    then
        ${MDATA_GET} user-script > /tmp/user-script
        ${CHMOD} +x /tmp/user-script
        /tmp/user-script
        ${MDATA_DELETE} ${RUN_TRIGGER}
    fi
    ${SLEEP} ${CHECK_INTERVAL}
done
_EOF

${CHMOD} u+x /tmp/rerun-user-script

${NOHUP} /tmp/rerun-user-script 2>/tmp/rerun-user-script.stderr >tmp/rerun-user-script.stdout &

'''